import React from "react";
import { BrowserRouter , Form, Link, Route} from "react-router-dom";



const App = () => {
  return (
    <>
        < BrowserRouter>
        <nav className="navbar">
          
          <h1>Teknolojik Yemekler</h1>
          <p><Link to="/">Ana Sayfa</Link></p>
        
        <Route path="/" 
        render={()=>{
         return <p>Ana Sayfa </p>;}}/>
        
        
        </nav>
      </ BrowserRouter>
      
    </>
  );
};


export default App;
